import classes from './Explore.module.css'
const Explore = () => {
  return (
    <div className={classes.explorecontainer}>
      <div className={classes.exploreimage}>
        <img src="" alt="" />
      </div>
      <div className={classes.exploreheading}>
        <p></p>
      </div>
    </div>
  );
};
export default Explore;
